import React from 'react';
import './App.css';
import TodoItem from './TodoItem'



function App(props) {
  const name =[1, 2, 3]
  const doubled = name.map(function(name){
    return name*2
  })
  console.log(doubled)

  return (
    <div>
      <TodoItem dothis="lets do this"/>
      <TodoItem dothis="don't do this"/>
      <TodoItem dothis="go do this"/>
      <TodoItem dothis="fuck you do this"/>
      <TodoItem dothis="okay, do this"/>

    </div>
  )
}

export default App;
